import React from 'react';
import { StyleSheet, View, Button, Text, Image, Dimensions} from 'react-native';
import { useState, useEffect } from 'react';
import emoji from '../JSON/emojiJson.json'
//====================================================================
import {getEmojis} from '../axios/accessServer';
//====================================================================
const EmojiComp = async({ CallbackFunction, lastEmoji }) => {
    const [currentEmoji, setCurrentEmoji] = useState(lastEmoji)
    const [emojisList, setEmojisList] = useState([]);
    const [isLoading, setIsLoading] = useState(true);

    useEffect(() => {
        const fetchEmojis = async () => {
          try {
            const emojisResponse = await getEmojis();
            const emojisData = await emojisResponse.json();
            setEmojisList(emojisData);
            setIsLoading(false);
          } catch (error) {
            console.error('Failed to fetch emojis:', error);
            setIsLoading(false);
          }
        };
        fetchEmojis();
      }, []);
    
      if (isLoading) {
        return <div>Loading...</div>;
      }
    

    
   
   

    return(
        <View style={styles.container}>

            {CallbackFunction(currentEmoji)}
            
